import { Hamburger } from "../hamburger/hamburger.component"
import { NavBar, Heading } from "./nav.styles"

export const Nav = ({title}) => {
    return (
        <NavBar>
            <Hamburger/>
            <Heading> {title} </Heading>
        </NavBar>
    )
}
